import React from 'react';
import { List } from 'semantic-ui-react'
import PollHeader from '../components/PollHeader';

const Administrator = () => {
    return (
        <div>
            <PollHeader />
            <List divided relaxed>
                {renderPollItems()}
            </List>
        </div>
    )
}
export default Administrator;
